import styled from 'styled-components';

export const HomeWrapper = styled.div`
    display: flex;
    flex-direction: column;
`;

export const StyledBanner = styled.section`
    display: flex;
    flex-direction: column;
    width: 100%;
    align-items: center;

    h1 {
        font-size: 5rem;
    }
`;
